import React from 'react';
import './components.css';

const Featured: React.FC = () => {
  return (
    <div className="featured">
      <div className="featured-video">
        <img src="path_to_featured_image.jpg" alt="Featured" />
        <div className="video-info">
          <h2>Guess Who Doesn't Watch "House of the Dragon"</h2>
          <p>The Cast Reveal Who Actually Watches the Show</p>
        </div>
      </div>
      <div className="up-next">
        <h3>Up next</h3>
        <ul>
          <li><p>'The Imaginary' Is Coming to Netflix on July 5</p></li>
          <li><p>"The Acolyte," Star Wars Fan Fiction, and More</p></li>
          <li><p>Ishana Night Shyamalan Picks Her Top Miyazaki Films</p></li>
        </ul>
      </div>
    </div>
  );
}

export default Featured;
